<app-voyage-create (voyageCreated)="onVoyageCreated($event)"></app-voyage-create>
<div *ngFor="let voyage of voyages">
  <app-voyage-card [voyage]="voyage"></app-voyage-card> <!-- Pass voyage data to the card -->
</div>
<app-footer></app-footer>
